def unique_elements(hmaps, key):

    def get_key_elements(hmap, key):
        keys = key.split('')
        value = hmap
        for each_key in keys:
            if each_key not in value:
                raise KeyNotFoundException('The key was not found in the map')
            value = value[each_key]
        return value
